async function getV2TweetJson(post_id, bearerToken) {
    tweet_lookup_url = `https://api.twitter.com/2/tweets?ids=${post_id}&tweet.fields=author_id,created_at,entities,geo,lang,referenced_tweets,source&expansions=attachments.media_keys,author_id,referenced_tweets.id,geo.place_id&user.fields=profile_image_url,public_metrics,location,verified&media.fields=duration_ms&place.fields=country_code`
    return fetch(tweet_lookup_url, {
        method: 'GET',
        headers: {
            "Content-Type": "application/json",
            'Authorization': `Bearer ${bearerToken}`
        }
    })
        .then(res => {
            return res.text()
        })
}

